package practice_Prog;

public class Demo1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("10 \n20 \n30");// \n = next line
		System.out.println(10+'\n'+20 +'\n'+30);// \n=10
		System.out.println(10+'\t'+20+'\t'+30);// \t=9
		System.out.println("\n");
		System.out.println('A'*'B');

	}

}
